import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" {...props}><path fill="#a1a1a1" stroke="#464646" strokeMiterlimit={10} d="M.5.5h15v15H.5z" /><path fill="none" stroke="#fff" strokeLinecap="round" strokeMiterlimit={10} d="M3.5 3.5l9 9M12.5 3.5l-9 9" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">  <rect x="0.5" y="0.5" width="15" height="15" fill="#a1a1a1" stroke="#464646" stroke-miterlimit="10"/>  <line x1="3.5" y1="3.5" x2="12.5" y2="12.5" fill="none" stroke="#fff" stroke-linecap="round" stroke-miterlimit="10"/>  <line x1="12.5" y1="3.5" x2="3.5" y2="12.5" fill="none" stroke="#fff" stroke-linecap="round" stroke-miterlimit="10"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
